// Or do we need a specific component just for editing?

import React from "react";

function ChefProfile() {
  return (
    <>
      <h1>
        I'm a chef's personal profile. I'll have two different views, one for an
        authorized user and one for guests.
      </h1>
      <button>Create Post-AU</button>
      <h2>OR</h2>
      <button>Return to Recipes-GU</button>
      <button>Return to Chefs-GU</button>
    </>
  );
}

export default ChefProfile;
